import React from "react";
import { Card, Col, Row } from "react-bootstrap";

const CartItems=(props)=>{

    return(
        <li>
            <Card style={{width: "5rem"}}>
                <Card.Img src={props.url} />
            </Card>
            <Row xs={3}>
                <Col>{props.title}</Col>
                <Col>{props.price}</Col>
                <Col>Quantity</Col>
            </Row>
        </li>
    )
}

export default CartItems
